INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 0.0, 0.0, "2020/07/31 12:00:00", 401, 0.0, 24, 24001, "2030/12/17 14:59:59", "アヤネ", 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 0.0, 2.21, "2020/07/31 12:00:00", 402, 0.0, 24, 24002, "2030/12/17 14:59:59", "アヤネ", 2, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 0.0, 0.0, "2020/07/31 12:00:00", 403, 0.0, 24, 24003, "2030/12/17 14:59:59", "アヤネ", 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 0.0, 1.99, "2020/07/31 12:00:00", 701, 0.0, 24, 24004, "2030/12/17 14:59:59", "アサヒ", 1, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 0.0, 2.21, "2020/07/31 12:00:00", 702, 0.0, 24, 24005, "2030/12/17 14:59:59", "アサヒ", 2, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 0.0, 3.33, "2020/07/31 12:00:00", 703, 0.0, 24, 24006, "2030/12/17 14:59:59", "アサヒ", 1, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 0.0, 0.0, "2020/07/31 12:00:00", 801, 0.0, 24, 24007, "2030/12/17 14:59:59", "部員３", 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 0.0, 2.68, "2020/07/31 12:00:00", 802, 0.0, 24, 24008, "2030/12/17 14:59:59", "部員３", 2, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 0.0, 0.0, "2020/07/31 12:00:00", 803, 0.0, 24, 24009, "2030/12/17 14:59:59", "部員３", 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 0.0, 0.0, "2020/07/31 12:00:00", 501, 0.0, 24, 24010, "2030/12/17 14:59:59", "", 1, "やった！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 0.0, 0.0, "2020/07/31 12:00:00", 502, 0.0, 24, 24011, "2030/12/17 14:59:59", "", 1, "勝ったよ！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 0.0, 0.0, "2020/07/31 12:00:00", 503, 0.0, 24, 24012, "2030/12/17 14:59:59", "", 1, "いい調子！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 0.0, 5.33, "2020/07/31 12:00:00", 111, 0.0, 24, 24013, "2030/12/17 14:59:59", "ミサト", 2, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 0.0, 6.85, "2020/07/31 12:00:00", 112, 0.0, 24, 24014, "2030/12/17 14:59:59", "ミサト", 2, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, 0.0, 3.0, "2020/07/31 12:00:00", 113, 0.0, 24, 24015, "2030/12/17 14:59:59", "ミサト", 2, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 0.0, 6.11, "2020/07/31 12:00:00", 611, 0.0, 24, 24016, "2030/12/17 14:59:59", "ダイチ", 2, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 0.0, 6.75, "2020/07/31 12:00:00", 612, 0.0, 24, 24017, "2030/12/17 14:59:59", "ダイチ", 2, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192401, 0.0, 0.0, "2020/07/31 12:00:00", 613, 0.0, 24, 24018, "2030/12/17 14:59:59", "ダイチ", 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 0.0, 4.52, "2020/07/31 12:00:00", 211, 0.0, 24, 24019, "2030/12/17 14:59:59", "ハツネ", 1, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 0.0, 3.89, "2020/07/31 12:00:00", 212, 0.0, 24, 24020, "2030/12/17 14:59:59", "ハツネ", 1, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113401, 0.0, 13.49, "2020/07/31 12:00:00", 213, 0.0, 24, 24021, "2030/12/17 14:59:59", "ハツネ", 2, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 0.0, 3.17, "2020/07/31 12:00:00", 311, 0.0, 24, 24022, "2030/12/17 14:59:59", "カヤ", 2, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 0.0, 4.42, "2020/07/31 12:00:00", 312, 0.0, 24, 24023, "2030/12/17 14:59:59", "カヤ", 2, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (106501, 0.0, 2.89, "2020/07/31 12:00:00", 313, 0.0, 24, 24024, "2030/12/17 14:59:59", "カヤ", 1, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (102301, 0.0, 3.71, "2020/07/31 12:00:00", 421, 0.0, 24, 24025, "2030/12/17 14:59:59", "アヤネ", 3, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192201, 0.0, 5.1, "2020/07/31 12:00:00", 721, 0.0, 24, 24026, "2030/12/17 14:59:59", "アサヒ", 1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192301, 0.0, 4.34, "2020/07/31 12:00:00", 821, 0.0, 24, 24027, "2030/12/17 14:59:59", "部員３", 3, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (192501, 0.0, 0.0, "2020/07/31 12:00:00", 521, 0.0, 24, 24028, "2030/12/17 14:59:59", "", 1, "いい勝負だったよ\nまたやろうね", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, -360.0, 5.62, "2020/07/31 12:00:00", 101, 0.0, 24, 24029, "2030/12/17 14:59:59", "ミサト", 2, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, -360.0, 9.58, "2020/07/31 12:00:00", 102, 0.0, 24, 24030, "2030/12/17 14:59:59", "ミサト", 2, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, -360.0, 0.0, "2020/07/31 12:00:00", 103, 0.0, 24, 24031, "2030/12/17 14:59:59", "ミサト", 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, -360.0, 9.13, "2020/07/31 12:00:00", 104, 0.0, 24, 24032, "2030/12/17 14:59:59", "ミサト", 1, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 10046);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (113501, -360.0, 8.27, "2020/07/31 12:00:00", 105, 0.0, 24, 24033, "2030/12/17 14:59:59", "ミサト", 2, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 10046);
